import React, { useEffect, useState } from 'react';
import "bootstrap/dist/css/bootstrap.css";
import { NavLink, useNavigate } from "react-router-dom";
import { useAuth } from "./AuthProvider";
import { Dropdown, Nav, Navbar as BootstrapNavbar, Container } from 'react-bootstrap';

const Logo = "https://static.vecteezy.com/system/resources/thumbnails/013/948/616/small/bank-icon-logo-design-vector.jpg";

export default function Navbar() {
  const { logout, user } = useAuth();
  const [role, setRole] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const checkUserRole = async () => {
      if (user) {
        try {
          setIsLoading(true);
          const accountnum = localStorage.getItem("accountnum");
          const response = await fetch(`https://localhost:3001/user/checkUser?accountnum=${accountnum}`, {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
              Authorization: `Bearer ${localStorage.getItem("token")}`,
            },
          });

          if (response.ok) {
            const data = await response.json();
            setRole(data.role);
          } else {
            const errorData = await response.json();
            setError(errorData.message || "Error fetching role");
          }
        } catch (error) {
          console.error("Error checking user role:", error);
          setError("Network error");
        } finally {
          setIsLoading(false);
        }
      } else {
        setRole(null);
        setIsLoading(false);
        setError(null);
      }
    };

    checkUserRole();
  }, [user]);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <BootstrapNavbar expand="lg" bg="light">
      <Container>
        <NavLink className="navbar-brand" to="/">
          <img src={Logo} alt="Bank Logo" style={{ width: '40px', height: '40px', marginRight: '10px' }} />
        </NavLink>
        <BootstrapNavbar.Toggle aria-controls="basic-navbar-nav" />
        <BootstrapNavbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            {isLoading && (
              <Nav.Link disabled>Loading...</Nav.Link>
            )}
            
            {error && (
              <Nav.Link className="text-danger">{error}</Nav.Link>
            )}

            {!user && !isLoading && (
              <>
                <NavLink className="nav-link" to="/login">
                  Login
                </NavLink>
                <NavLink className="nav-link" to="/signup">
                  Sign Up
                </NavLink>
                <NavLink className="nav-link" to="/tellerLogin">
                  Employees
                </NavLink>
              </>
            )}

            {user && !isLoading && role === 'user' && (
              <Dropdown>
                <Dropdown.Toggle variant="light" id="dropdown-basic">
                  User Menu
                </Dropdown.Toggle>
                <Dropdown.Menu>
                  <Dropdown.Item as={NavLink} to="/viewtransactions">
                    View my transactions
                  </Dropdown.Item>
                  <Dropdown.Item as={NavLink} to="/newtransaction">
                    New Transaction
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            )}

            {user && !isLoading && role === 'teller' && (
              <Dropdown>
                <Dropdown.Toggle variant="light" id="dropdown-basic">
                  Teller Menu
                </Dropdown.Toggle>
                <Dropdown.Menu>
                  <Dropdown.Item as={NavLink} to="/tellerSignup">
                    Add Teller
                  </Dropdown.Item>
                  <Dropdown.Item as={NavLink} to="/viewAllTransactions">
                    View All Transactions
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            )}

            {user && !isLoading && (
              <Nav.Link onClick={handleLogout} title="Logout">
                Logout
              </Nav.Link>
            )}
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
}
